  async tiAction() {
    let start_date = '2025-07-05 22:50:31'
    let end_date = '2025-07-05'

    const now = new Date()

    // 解析日期字符串为本地时间对象
    const parseLocalDate = (dateStr, isEndDate = false) => {
      if (!dateStr) return null

      if (dateStr.length === 10) {
        // 处理 YYYY-MM-DD 格式
        const [year, month, day] = dateStr.split('-').map(Number)
        const date = new Date(year, month - 1, day)

        if (isEndDate) {
          date.setHours(23, 59, 59, 999)
        } else {
          date.setHours(0, 0, 0, 0)
        }
        return date
      } else {
        // 处理 YYYY-MM-DD HH:mm:ss 格式
        const [datePart, timePart] = dateStr.split(' ')
        const [year, month, day] = datePart.split('-').map(Number)
        const [hours, minutes, seconds] = timePart.split(':').map(Number)

        return new Date(year, month - 1, day, hours, minutes, seconds)
      }
    }

    // 解析日期
    let start = parseLocalDate(start_date)
    let end = parseLocalDate(end_date, true)

    // 处理无效日期
    if (start && isNaN(start.getTime())) start = null
    if (end && isNaN(end.getTime())) end = null

    // 判断逻辑
    let res = false
    if (start === null && end === null) {
      res = true
    } else if (start === null) {
      res = now <= end
    } else if (end === null) {
      res = now >= start
    } else {
      res = now >= start && now <= end
    }
    return res
  }

  async msTestAction() {
    const sender = 'ai374949369'
    const receiver = 'smjiloveyou'
    const startTime = new Date(Date.now() - 24 * 60 * 60 * 1000)
      .toISOString()
      .slice(0, 19)
      .replace('T', ' ')

    const messages = await this.model('messages').query(`
    SELECT * 
  FROM ai_messages 
  WHERE (
    (from_user = '${sender}' AND to_user = '${receiver}')
    OR (from_user = '${receiver}' AND to_user = '${sender}')
  )
  AND msg_type = 1
  AND create_at >= '${startTime}'
  ORDER BY create_time ASC
  `)
    return this.success(messages)
  }
